def can_compose_letter(s1: str, s2: str) -> str:
    s1 = ''.join(s1.split())
    s2 = ''.join(s2.split())
    s1_count = {}
    for char in s1:
        if char in s1_count:
            s1_count[char] += 1
        else:
            s1_count[char] = 1
    for char in s2:
        if char not in s1_count or s1_count[char] == 0:
            return 'NO'
        s1_count[char] += 1
    return 'YES'

